import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Task1 from './Component_Day14/Task1';
import Demo2 from './Component_Day14/Demo2';
import InlineCSS from './Component_Day14/InlineCSS';
import Demo_Framework from './Component_Day14/Demo_Framework';
import Demo_F2 from './Component_Day14/Demo_F2';



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App/>
    <Task1/>
    <Demo2/>
    <InlineCSS/>
    <Demo_Framework/>
    <div className='row'></div>

  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
